description:
Es steht jetzt fest, die Dreharbeiten im Studio und in Beyharting für &quot;Das Asylheim im Maisfeld 🌽🌽🌽&quot; finden erst 2023, nach der Winterpause statt. Die Container sind zwar fast fertig, aber der Catering-Bereich noch nicht.
Momo und Yinka kommen neben Ken Hugelfink auch nach Sizilien mit.
In &quot;Das Asylheim im Maisfeld 🌽🌽🌽&quot; kommen natürlich auch Rückblenden vor, wo die Jungs über ihre Vergangenheit erzählen. Die beiden kamen via Italien 🇮🇹 und es ist geplant, das vor Ort zu drehen.
Momo ist ganz aus dem Häuschen: &quot;Sizilien! Wow! Können wir dann das Dorf Corleone besuchen? Weißt du, &quot;The Godfather&quot; ist mein Lieblingsfilm!&quot;
&quot;Na ja, mal sehen. Inshaallah. Wenn da ein Bus rauffährt und nicht zu viel Schnee liegt!&quot;
Yinka ist nicht so begeistert. Er hat Angst. Er würde erst in Deutschland lieber richtig Wurzeln schlagen und nicht wieder zurück nach Italien.
&quot;Keine Sorge. Du reist als offizielles Mitglied unserer Filmcrew, und das KVR hat es auch genehmigt.&quot;
Aber so ganz überzeugt ist er nicht.

Antzoki Zaharra
Argazkia / Fotografía: Floro Azqueta
